        ["ShortDescription"] = "(Chapter 2) Princess Peppermint rejoiced! The treasured mascot of seasonal confectionary would make it to the contest after all! As she prepared for the baking contest, she tightened her silky sweetheart neckline corset, & fetched her mother's ruby red & emerald outlined necklace for good luck! As the Aurora Borealis twinkled above her in the starry sky, she sweetly thanked her animal companions. The reindeer gave her a ride to the contest, & she turned heads with her illustrious outfit... It was then that it dawned upon her, amongst all the worry, she had forgotten what truly mattered; she had left her baking equipment behind! Her lips trembled as she realised... She would surely be disqualified for her thoughtlessness... But most terribly... Her friend's efforts were all for naught! What was a princess to do now? ... This corset is yet another recreation of her classic clothing, with a dipped neckline & back, and lavish necklace, this corset befits anybody late for the annual cookie baking contest! (written by stixxntricks)",
