        },
        ["ShortDescription"] = "Available to win during the Winter Event! Cozy up & cuddle close to your couch with the increased comfort provided by this trendsetting & luxurious stole scarf! Suitable for usage as a blanket whenever you find yourself snowed-in & marathoning bad holiday movies, keep the staples of the season near stylistically, while never permitting them to cause a chill to shake up your spine! A must-have for any cold snap, while snowbound inside your home, you'll surely see yourself clutching it as you stare with a hot cup of cocoa at the snowy streets from behind your glaciated glass window, but you'll never have to worry about the winter while keeping your wits about you & wrapping up warm! You'll likely find yourself keeping it attached to your form even after you are rescued from your state of isolation by it thawing out, it's just that snug! It'll never allow you to succumb to the cold, all the while securing your seasonal style with its meticulously hand-stitched elaborate snowflake lacing aligning the trim! (written by stixxntricks)",
