        ["Icon"] = "rbxassetid://7969718150",
        ["Alias"] = "Christmas Window Shopping Top Hat",
        ["ShortDescription"] = "Available to win during the Winter Event! A continuously repurposed top hat that still manages to maintain its smart & astute veneer! Wrapped with a gifting box ribbon & topped off with a prim & miraculously magical poinsettia, this hat is shipped to the North Pole from the same crafters as the 'North Pole Presents Skirt', recycled using any remaining materials from the skirt sculpting process! Although you originally sourced yours from the stringy, straggly head of a flimsily stitched together scarecrow, you figured it wouldn't find much use atop its head while the field was barren & thick with snow, & that it would fit much better on your snowman instead! Positioned in front of a store window, your lumpy creation could only observe as the holiday decor gradually receded as the season climbed to its closing hour, & subsequently his own... Passing by it later in the month, you find its sharp qualities have been perfectly preserved, & that it'll fit just fine reused as a functioning piece of headwear! (written by stixxntricks)"
