    ["Celestial Flower Bouquet"] = {
        ["Price"] = 8500,
        ["Unavailable"] = true,
        ["ShortDescription"] = [[(Celestial Spoils, Chapter 2) For the legend of the one who walked in beauty, like the night, all that's best of dark & bright, the story continues under surprisingly solemn circumstances. Upon returning to Earth, the starry eyed wanderer walked through a world without wonder. Muted in comparison to the spectacle of space, they stepped across continents as if striding to their own wake, a silent observer spoiled by the stars & sadly swept up by the endless epiphany of an eternal universe. During a meteor shower, cascading stardust formed a bouquet of interstellar lillies in their gloomy grip, charity for the loss of charm caused by the majesty of the cosmos. The card attached to the stems twinkled when it was twisted at the right angle to reflect light. A message from a mourning side of the stars simply stated;
'We're sorry.'
To which the wayfarer threw the torn apart fragments of paper to the wavering winds... A collective of faux lillies crafted by the stars themselves! They were also intended to be worn in your hair; celestial bodies thought they'd look lovely with anything that can stir the lost starlight in their irises again...(Written by stixxntricks)]],
