    ["December's Dream Coat"] = {
        ["Price"] = 35000,
        ["Unavailable"] = true,
        ["ShortDescription"] = "(December's Dream, Chapter 4) An outside observer to the man moving inside, he never felt her distant, vacant gaze. She watched as he plucked items off the shelf, indifferent eyes scanning mechanically over the paper packaging. This tune that she yearned to remember... Before she moved to the supposed majesty of the metropolis, this pianist's melody would occasionally play on the radio while she worked as a cashier. She never did discover its name. Watching as the man tugged his stylish coat closer to his business clothing, cufflinks shining as they caught up in the blinding fluorescent lights, melodic memories kept her frozen in place. Ever moving while never moving, her life swept through her mind like the first spluttering signs of snow. A brief forever ago, she was a scholarly student, high-spirited with clear ambitions towards the art of dance that were shrouded somewhere along the way, wayward within an ocean of cold skyscrapers... (written by stixxntricks)",
