        ["ShortDescription"] = [[A set of highly adjustable lightweight headphones, perfect & pointed for punk rock! Newly incorporated acoustic technology can now allow an ultimate over-ear wireless experience, with top-notch cushioning noise-cancelling technology catering to any environmental volumes so you can head bang in style, or toggle to hang them from your neck! Internally composed of anodized aluminum, the outer plastic casing provides for greater customization; as the cracked heart can be toggled to be repaired with adorned angelic wings, or a seashell! The conceptual creator of these headphones was reportedly a patron of the musical arts. While they insisted on only utilizing the most brilliant & sound boosting materials that diamonds can buy, & put extra emphasis on user personalization, scarce information exists on this obscure & elusive individual. Some satiny string circles around the hard shell, just above the split in half heart. When unwrapped, the underside displays inky, blotchy black text, barely able to be deciphered...
