        ["Icons"] = {"rbxassetid://18401575275", "rbxassetid://18405562420", "rbxassetid://18405616054"},
        ["Variants"] = true,
        ["ShortDescription"] = [[Earn this by completing 5 Royale Bingo rows (Series 1) OR by redeeming your code from the Valkyrie Doll to obtain this item, plus the rest of the Valkyrie set! ~Tradable!~ 
An illuminous cape handwoven by a strong sisterhood of aspiring valkyries and valkyries of the past, it flurries through the air as you fly‚Ä¶ Fitting for a true hero of the realms! It flutters with an otherworldly light that seems to instill hope in those who view it. Featuring an array of toggles, its length can be changed to long or extra long, determine the speed at which the wind billows it higher, and its transparency can be dimmed or strengthened however its beholder desires!

(A Small Spark, Chapter 5 ‚Äî Luminous Cape) For how the fabric stitched by her sisterhood's caring hands were also the same as those that spun a legacy of great warrior women. Standing in the noble hallway atop the clouds, she feels the ends of her cape trailing the marble floor like a dog with its tail between its legs. She stares at the outlines on the wall. She remembers walking these corridors countless times before, and crawling across them before she was capable of that.
‚ÄúI've never really looked at the pictures on the walls before.‚Äù Her friend muses by her side, head flitting this way and that at the carvings. For the different women carved in marble, with different eyes, hair, noses, lips, of all shapes and sizes, all donning the same uniform. For how the past stares back at Lumina with... Welcoming smiles. For how Lumina's irises cannot help but drift down to the ground, mouth slightly agape.
‚ÄúUhm. Well... They get... Easier to take in with every visit, I guess.‚Äù]],
