        ["ShortDescription"] = "Available to win during the Winter Event! (The Snowglobe Story, Chapter 1) It was from the noble Aurora's frosted signature longsword that the fiends of the summit were vanquished, proving that even the most meager of peasants can rise above without regal talons to command them prompted an assured outcry from the long mistreated lower class, wherein the unfeeling queen was subsequently dethroned & replaced with a corresponding & caring community. Before peace prospered, the cold queen's knuckles whitened as her control on the people's labored misery splintered under Aurora's influence. She challenged Aurora to a duel. If victory was to be given to the peasant girl, she would release her grip on her people. Leaving only claw marks in her wake. However, if she failed, Aurora would be cast into an uncaring cyclone of the queen's own bewitching creation... Unsheathe this twisting saber & take to heart that some live by the blade & make a martyr out of themselves because of it, but only the most skilled combatants use it as a lifeline. For the astute & quick-witted, the phrase 'dulce et decorum est pro patria mori' is but a tragic lie, she who survived to tell the tale would share it for all to hear; ardent glory is only found with your feet poised & securely planted on the snow trodden battleground, above the steadily sloping abyss of your glacial subterranean grave. (written by stixxntricks)",
