    ["Celestial Cathedral Veil"] = {
        ["Price"] = 15000,
        ["Unavailable"] = true,
        ["ShortDescription"] = "(Celestial Spoils, Chapter 1) Myths permeate that the one who scattered gemstones while traversing the stars in search of seraphic sanctuary caused the stars to spark with sorcery, creating a cathedral on the moon. After rising from sleep within this shelter, they found an exclusive veil trailing their stellar strolls! For even that which glimmers & shimmers in the night sky finds itself lonesome sometimes, so in thanks for adding to the constellations, they then shot down from astronomical heights followed by this flourishing fabric, heaven sent from the astronomical astrals above! The cathedral then crumbled without the pathfinder, its grandeur subdued within the grandiose galaxy... The lustre of the illuminated is alight by bright ideas; legend says a false flowercrown will be given as an additional virtue, & the veil itself is rumoured to be able to adjust to those of different heights. The majesty of the magical material also allows ample space for a flowercrown & veil combo if 2 'Celestial Cathedral Veil's are equipped together! How ceaselessly stylish our stars are! (Written by stixxntricks) (*Stackable)",
