    ["Steampunk Inventor Bodice"] = {
        ["PartsToHide"] = {"UpperTorso", "LowerTorso"},
        ["Unavailable"] = true,
        ["ShortDescription"] = "A top-notch bodice fit for protecting any idea-riddled yet still style savvy inventor! Preserved in the basements of the Wickery Railway Station, an entire collection of these bodices have been restored & fully stocked onto Student Store shelves in the modern era, & just like Wickery itself, they are entirely unchanged from the Victorian age! With an onslaught of sturdy straps & a smart jabot choker above a smart shirt, this classical piece adds a touch of authenticity to those who have a particular steampunk sense of style, even while being utilized for their main original function; to protect engineers & workers from bumps & scraps. Fitting both Boy and Woman, this bodice comes with 21-23 toggles!(written by stixxntricks)",
