    ["Frozen Royalty Crown"] = {
        ["Recolor"] = "Multi",
        ["Creator"] = "PureSweetener",
        ["Tags"] = "Hats",
        ["NumColorGroups"] = 0,
        ["Unavailable"] = true,
        ["Variants"] = true,
        ["Alias"] = "Frozen Royalty Crown",
        ["ShortDescription"] = "Available to win during the Winter Event! (The Snowglobe Story, Chapter 5) Once the queen was vanquished, the sharp particles of the blizzard awaiting Aurora embued with her rage hung suspended in the icy air like collapsing comets abruptly stopping in their descent. A twist in the tale states it was not Aurora's blade that brought about her defeat. The untamed & fittingly nicknamed 'Beast of the Blizzard' who dealt her chaotic downfall sluggishly retreated through snowdrifts, & slipped into a profound slumber somewhere deep within the caverns of the summit, attempting to thwart the steadily spreading algor in its chest... While the legends circulate that the monster is no myth, that its blood remains as rigid as the glacial underbelly itself because of the queen's influence, & that its state of cryostasis is preserved to this very day, the last remnants of the one who ruled with a frosted sword begged to be discarded, & thus were left to their resting place in the snowy bed of the white tundra. The jewels from history long gone hail obsolete to the residents, their stares easy-going & lively even while you wear the scattered remains of their sovereignty upon your head. Some fairies may mutter that the shining specter stirs the soul with remembrance as their own faces reflect against the gemstones, but they're not frozen in place, & progress past it. The connections that they make are worth the continuous sculpting, for they're valued far above the embellished ornateness of this coronet. You believe you can pantomime as a ruler while exhibiting this relic without fretting over the possibility of becoming corrupt to the evils that can come along with the title. Regality & the storm it situates will never rest upon your innocent soul, that is an unshakable fate for the far more cold-hearted... This is how you reassure yourself when you hear faint, callous cackling carried close to your ears with the wild winter winds. Perhaps some storms are best left pendulous in the past, but some never truly subside... (written by stixxntricks)",
