        ["ShortDescription"] = "(December's Dream, Chapter 1) December stared up into the face of an icy moon on a starless night, the glazed glow spilling into the same stale blue hue she would witness every evening. The train's doors shakily shutting behind her, she stepped silently into the uncaring, quiet commotion that could only be found in the restless metropolitan nighttime. So profound that she could be whited-out into insignificance amongst the school of pedantic pedestrians that filtered through the cold current known more commonly as the big city... A stray snowflake descended from a torn apart cloud, sticking to the closely-knit fabricated fur of her cossack hat. Similarly to herself, it inevitably melted, lost within the workings of a monotonous mass, but unable to fully immerse itself inside the patterns of the herd while feeling so innately singular. Too wrapped up in their own moments to even share a passing glance with a wonderful woman such as herself while simply strolling down the sidewalk... (written by stixxntricks)",
