    ["Valkyrie Sword and Shield"] = {
        ["Recolor"] = "Multi",
        ["Subfolder"] = "Shop",
        ["Tags"] = {"Arms", "Hands"},
        ["NumColorGroups"] = 0,
        ["Unavailable"] = true,
        ["Icons"] = {"rbxassetid://18401575762", "rbxassetid://18405562420", "rbxassetid://18405616054"},
        ["ShortDescription"] = [[Earn this by completing 4 Royale Bingo rows (Series 1) OR by redeeming your code from the Valkyrie Doll to obtain this item, plus the rest of the Valkyrie set! ~Tradable!~ 
A new sword & shield included together as one, officially bestowed to every aspiring valkyrie from their peers upon first agreement to an ancient & sworn oath to protect the realms from evil. The finely crafted hilt and blade showcase the grace and elegance of a valkyrie‚Äôs strength, while the shield‚Äôs sturdy circular form offers both defense and offense; for it may be thrown at enemies, only to boomerang back into your grip.

(A Small Spark, Chapter 3 ‚Äî Valkyrie Sworn Oath Sword) For the days she'd close in on her battlemates, her valiant sisters, in their training quarters. For how she'd slide in close, blade on blade with her opponent, her brow drawn and teeth grit. For when her muscles buckled under the sheer gravity of this intense pressure... For the time the previous title bearer, the burly, wrinkled pillar of strength that she is, pulled her aside. Lip wobbling, her big blue eyes bubbled with tears as she lifted her head to meet the lights above.
‚ÄúLittle Lumina.‚Äù Her guiding elder murmured, reverent fingers guiding the little valkyrie's face so their eyes may meet. Not too different. But the youth, the youth just needs time.
‚ÄúIf you falter,‚Äù The matriarch starts... Tears wet Lumina's eyelashes, her body tensing. ‚ÄúYou've the strong arms of all of us waiting to support you.‚Äù

(A Small Spark, Chapter 4 ‚Äî Valkyrie Sworn Oath Shield) For on her first mission, on the school grounds, when the vile beast of oozing dark magical tar shot its liquid venom towards her shining figure, she thought to shield the students first with her solid shield before her own self. For how she had elegantly swooped over, cape swaying, to wield her sword & shield when she‚Äôd heard of a dark elemental student‚Äôs science project gone wrong was now bubbling into a dark monster...
For how her shield flew through the air like a discus, deflecting the black acid, & projecting the monster's hubris back into its own face. For how her shield boomeranged across the battlefield, right back into her awaiting hands. For how she stared straight into the face of the unknown, the abyss of nothingness in that churning mass of darkness‚Ä¶
And could only think of the students cowering behind her. For how her fingers, tightly curled around her shield's handle, how she did not quiver as she charged the creature, sword raised.]],
