        ["ShortDescription"] = "(December's Dream, Chapter 5) The fellow she'd been unknowingly scrutinizing slowly stepped towards the checkout, a paper bag clutched loosely in one hand. At this angle, she could get a clearer picture of him. Eyebags lined his eyes, his visage the perfect portrait of an overworked businessman. While she performed the same tired dances on stage every day for an audience that viewed her as a distraction from their own boredom, she imagined he'd be hunched in front of a harsh screen in some cramped cubicle somewhere, rampantly high above the currents of civilization, but still just as uniquely lost within it as she was. As she stared through the settled frost on the glacial glass wall between them, she speculated over the concept of every single individual fish subdued under icy waters foolishly thinking it is somehow specially distinct in its own internal isolation. A sheer chill sliced through the thin lace of her sleeves, & she instinctively crossed her arms as it shook through her frail form, painted fingernails resting against her own bare skin. She had a coat strikingly similar to his, if only she'd remembered it before setting off on her routine that morning... Blinking, her eyes widened in recognition. The stranger she'd been watching was now staring directly at her... (written by stixxntricks)",
