        ["ShortDescription"] = [[Earn this by completing 6 Royale Bingo rows (Series 1) OR by redeeming your code from the Valkyrie Doll to obtain this item, plus the rest of the Valkyrie set! ~Tradable!~
A set of wings borne of a pure and untethered source of magic that a noble sisterhood of valkyrie‚Äôs use to protect the realms! They seem to twitch with eagerness, so lively that it may almost seem like they‚Äôve a mind of their own! With feathers brimming with excitement, those surrounding their wielder may feel the raw power emanating from within their heart‚Ä¶ These wings are totally toggleable; they can grow at will, you can go from any size, from a petite pixie to a grand high angel!

