For how a certain magical immortal stallion, who has tested centuries of those who loom before her (as he once stood by the original valkyrie who started it all), has ordained her final test; one which determines her title. For he declared that she must search for the sacred hallways which house the carvings of the previous ancestors ‚Äî the previous title bearers, the last guardians of the realms... For she has never found the path to those grounds herself, not without use of a teleportation scepter, not without her mischievous steed, who watches her ascent from afar‚Ä¶]],
