    ["Conscious Cotton Tote (Empty)"] = {
        ["AlternateOwnershipCheck"] = "Conscious Cotton Tote",
        ["Unavailable"] = true,
        ["ShortDescription"] = "A stylishly eco-conscious cotton tote bag that doesn't separate standards & sustainability! While the solid seams & tight craftwork ensure it won't be snatched away by the spring gales, it also allows additional support for those long overdue a substantial shopping trip as the temperature ascends & the sun shines even stronger! Breathe a sigh of relief alongside Mother Nature as you bid farewell to the flimsy & outdated plastic carriers of yesteryear with this tote while staying assured that both your closet & the Earth itself stays as fresh & fashionable as the darling daisy decal that embellishes this bag's exterior! (written by stixxntricks)",
