    ["Winter Halo 2021"] = {
        ["Recolor"] = "Multi",
        ["CantTryOn"] = true,
        ["Creator"] = "Vioncii & ixchoco_",
        ["Tags"] = "Halos",
        ["NumColorGroups"] = 0,
        ["Unavailable"] = true,
        ["Variants"] = false,
        ["ShortDescription"] = "Before the cracks in their queen's control began to thaw, the elevated elite enforced magic to suspend Snowglobe Summit above the clouds & enshroud it inside a sphere, a trick thinly disguised under the promise of additional protection for the already isolated inhabitants. It has permeated much longer than the suffering the rulers brought about while towering inside the altitudinous eye of a soundless storm of sorrows. Unfortunately, some pieces of the past still remain intact even upon impact. With the last royal & thus the knowledge of how to undo the encasing curse whited-out, the citizens are unable to be fully free from their shackles. The town remains unreachable in the stratosphere during any non-holiday, but they refuse to be frozen like toys inside a glass globe. While the residents once festered in cynicism, their goodwill eventually flourished into a hallmark of the once harsh land, which is now renowned as a tourist attraction during their fleeting festive freedom. In the wintertide after the regal demolition, they would learn about how the world enjoys winter, expanding their small worldview by eagerly welcoming strangers. To a town that had never celebrated life, how a candle is added to an alight Menorah, how kente is coated by dedicated Kwanzaa decorators, how the star on the Christmas tree shines, & many more, seemed more magical than a queen could ever be. Perhaps the cold could be forgiven, even after being twisted under the control of careless hands. This tiara captures a collection of the Northern Lights that cycle the summit's peak, gradually grouped by fractals of mystical residue that collided due to the change in attitude around the climate. As the sphere shattered, the seasonal spirit caused its shards to remain in the sky. Sculpted by its environment, a circlet of kindness crystallized by the same sorcery used to mistreat convinces the Aurora Borealis surrounding it to stay. You cannot stop considering the woes of winter, & how those misfortunes were shaped into warm welcomes while wearing it. Is this aureole a reminder of human compassion, or is it a caution to never become corrupt to the callousness a crown such as this can exemplify? (Written by stixxntricks)",
