        ["Icons"] = {"rbxassetid://18401577629", "rbxassetid://18405562420", "rbxassetid://18405616054"},
        ["ShortDescription"] = [[Earn this by completing your first Royale Bingo row (Series 1) OR by redeeming your code from the Valkyrie Doll to obtain this item, plus the rest of the Valkyrie set! ~Tradable!~ 
A radiant dress protected by a shining bodice of armor, the strongest steel of which could resist even the fieriest of blows of a dragon‚Äôs hammering claws‚Ä¶ And being bucked off your rambunctious steed. The dress beneath flows gracefully, allowing for greater agility and movement, the seams of which have been deftly fixed by older, experienced hands‚Ä¶ This piece may be toggled into a strapped bodice, a flowing dress, or a full plate of armor to the wearer‚Äôs desires! The shoulder plates are removable, the dress straps, even the motifs of the heart with wings at its center can be toggled off & on - and don't forget the gorgeous glowing rainbow diamond tulle that is an honor to wear!

(A Small Spark, Chapter 2 ‚Äî Radiant Dress) For the countless days and nights spent in the mountains, the forests surrounding the school. Where her weighted armor protected the sturdy cage of her ribs, beneath which beats a sure and steady heart. For how her skirt flurried in the breeze, as free as she sometimes yearned to be‚Ä¶ For although she may not admit it, under conditions, even an aspiring valkyrie‚Äôs patience is tested... Time and time again, she would traverse the trail, and when the steed bucked her ‚Äî and bucked her many times he did ‚Äî she would climb back atop his back.

‚ÄúMaybe... Maybe you just need time.‚Äù She would whisper in his ear, pointed back as if alert and listening. ‚ÄúKnow this! I do not break easily... But... Well, neither do you.‚Äù
All the steed could do was blink, taking in the sight of her, as he bucked her again... And she picked herself up, yet again.]],
