    ["Baby Chick Backpack"] = {
        ["Recolor"] = "Multi",
        ["Creator"] = "R0ssiie",
        ["Tags"] = "Back",
        ["NumColorGroups"] = 0,
        ["Unavailable"] = true,
        ["Variants"] = true,
        ["ShortDescription"] = "Score this plush backpack during the Easter season, so that you can take your kawaii baby chick with you wherever you go. Don't worry, it won't chirp if you bring it to class!",
        ["Alias"] = "Baby Chick Backpack",
        ["Style"] = {"Cute"},
        ["category"] = "Accessories",
        ["EquipsTo"] = "UpperTorso",
        ["Subfolder"] = "Easter",
        ["Icon"] = "rbxassetid://4887576800",
