    },
    ["Exquisite Emerald Earrings"] = {
        ["Recolor"] = "Multi",
        ["Creator"] = "Beeism",
        ["Tags"] = "Ears",
        ["NumColorGroups"] = 0,
        ["Unavailable"] = true,
        ["ShortDescription"] = "(The Green Eyed Monster - Chapter 2/3) A dastardly duo of enchanting emeralds held together with papery & weakly wavering auric casting. They seem to draw any attention away from your face & onto themselves instead, as they should. They are the most important & captivating aspect of your outfit, of course. While wearing them, you cannot evade agonization; surely their stoutly extending clasps are too stubby? & you run the risk of them descending onto the disgusting dirt below? That won't do. You may find it best to put them in an exhibition if you're fittingly fretting over the possibility of mistreating them. Such captivating chartreuse needs to be kept safe & sound... As gleeful gaiety reverbed against the enticing emeralds lading this open & exposed vein, the gaggle of miners raised their pickaxes to excavate these precious ores... Then stopped, mid-air. They strained, sweat dripping from their skin, unable to bring themselves to lower their grimy equipment. The jewels shone brightly - they felt themselves growing green with envy towards such undeniable, unobtainable virtue. As the group of miners at long last took a hike out of the literal goldmine almost empty-handed in credit to their sudden stop, they salvaged some adrift glorious gems from their ghastly gear that annoyingly arcanely resistant elves scrounged together to structure into 3 sets of jewelry. Understandably unable to miss out on the opportunity to parade such bewitching wonders... (written by stixxandtricks)",
        ["Style"] = {"Elegant"},
        ["category"] = "Accessories",
        ["Subfolder"] = "SaintPatricksDay",
        ["EquipsTo"] = "Head",
        ["Icon"] = "rbxassetid://4751430740",
        ["Alias"] = "Exquisite Emerald Earrings"
    },
