    ["Vaudevillian Ballroom Mask"] = {
        ["Unavailable"] = true,
        ["ShortDescription"] = "NEW! A style of mask utilized by humans in the early 20th century, this peculiar veil once sat on display at a museum before it disappeared without a trace... Now, after years of resurrection through second-hand shops, trash cans, & all of its previous owners mysteriously vanishing in unforeseen & fascinating circumstances, it's on the market for you to enjoy! Outlined by soft yet spiking feathers & decorated with a webbed crown, we recommend exhibiting this bejeweled dozing diva by their silvery ornate handle. This mask is a must-have for any masquerade, theater, or party! Please note; we do not accept returns, no matter how much terror the mask may inspire by moving spontaneously by itself. This visor is not particular, & therefore fits both 'Woman' & 'Boy' body types! (2O21 Release) (written by stixxntricks)",
