        ["Alias"] = "Daisy Diva Cap",
        ["ShortDescription"] = "After this poofy cap finds its way into your life, you may find yourself pondering its origins... Is it a lost signifier of a postal worker's uniform from the untouched past? Blown away as they pedaled into the blustering, brisk spring winds, not bothering to look behind them as the Valentines letter rush started to take its tiring toll? Or perhaps... Its purpose was always meant to simply uplift apparel? Mayhaps, long ago, it belonged to a stylist beyond their time at the brink of the new millennia... Delicately weaving a thin ribbon adorned with a demure daisy clip around the base... Someone so strikingly similar to yourself. The branching pathways of possibilities speak of the timelessness of the 'newsie cap' style. Worn by the wealthy & working-class alike in the early 20th century, this hat also saw a resurgence in popularity in early 2000's hipster culture. Maybe it may pave new trends onto the runway yet again if it's been considerately upcycled into your care! An ageless classic far exceeds any cheap knockoffs you may find today, for a hat that feasibly may have witnessed itself rotate in & out of style several times is not merely old, it is enduring! (written by stixxntricks)",
