        ["Unavailable"] = true,
        ["ShortDescription"] = "(December's Dream, Chapter 3) Half-lidded irises regarded the flickering, pale moonlight cast against the surface of the vast icy waters as December walked by the thin railings beside the river. Stretching from the outskirts right down to the capital, once, it stirred her heart ‚Äî buried beneath her buttoned-up bodice ‚Äî with excitement... But she'd fallen out of love with it. The once awe-inspiring skyline was as unremarkably extraordinary to her now as each individual narrative that transpired inside each miniature square window of light. She felt herself stop in her tracks. Her eyebrows creased as she searched for an explanation behind her abrupt interruption, people filtered by as though she was just another staple stirred into the splendid scenery that furbished their everyday monotony. Turning her head, she heard it. A song. Hailing from one of the nearby stores that neared its closing hour. Discreetly gasping, the sharp air stung her throat. The firm bow that kept the upper half of her clothing closed scratched against her skin, seemingly constricting, although she knew it could easily be removed. The ribbon wrapped around her waist copied, squeezing her stomach, she found herself wishing the weather wasn't so darn cold so she could at least remove her outer shirt during this terse intensity. Inhaling, she accumulated these snaking sensations, then expelled them with a sizeable sigh. Staring through steadily cascading snowflakes, a man inside caught her eye. Clad in a tight vest with a smart salaryman's shirt underneath, the collar peeking out against his neck... (written by stixxntricks)",
