        ["Style"] = {"Elegant", "Cute", "Boys"},
        ["category"] = "Accessories",
        ["Subfolder"] = "Christmas",
        ["ShortDescription"] = [[Available to win during the Winter Event! (The Snowglobe Story, Chapter 3) How far would you go to become as fleeting as a forgotten snowfall? Would you aboard a train, snuff out the wick of your old life, & rise above to another?
When ice governs all, you may not even notice that you've managed to make a home within the center of the storm. The prologue of the past permeates but is nothing is everlasting. The queen always had the choice to relinquish her talons.
Pre-teen princess Cassandra beheld a realm whose inhabitants no longer had a firm foundation from behind a splintering sheet of fanciful glass. A world without structure, or a heavy yet steady hand after the cold king had crumbled. Clasps clicking reverbed against the imposing walls of the palace's open foyer. As her stepmother shiveringly smoothed out her coat, Cassandra kept control.
'Right, that's it, I'm all packed.'
She spoke, a ghost of a smile on her face.
A glacier of silence. Cassandra sat on the window seat just behind the throne, while her matriarch could hardly see her from the only angle the ground below provided.
' ... Cassandra, you will look at me when I am speaking to you.'
The woman's words were stern, used to obedience. Inhaling the sharp air, the soon-to-be queen's lifetime so far accumulated inside her mind like the shards of snow compiling across the pane, a storm was starting to settle. Cracks had chipped into the royal public image within this skittish replacement parent's feeble clutches.
Shaking her head, the stepmother clenched the ornate handle of her suitcase, her carriage loomed, & she would not lend this insolent brat another second of her time.
'Await my return. Keep up your studies. The crown awaits a clever queen...'
Scoffing, heels clattered unceremoniously against the polished marble.
'Not one with her head stuck in the clouds.'
That night, Cassandra was stirred by servants. Stepmother's carriage had skidded off a slope during the seething tempest that had snowballed overnight, luggage littering the cliff was recovered, but nothing else.
(written by stixxntricks)]],
