        ["Unavailable"] = true,
        ["Variants"] = true,
        ["ShortDescription"] = "(Chapter 3, End) Tears brimmed in the eyes of the defeated & disheartened Princess Peppermint, acutely aware that she had made an idiot out of herself by crying in front of the crowded contest hall, & even worse, right beside her competition! The room sled down into a cold, still silence. The citizens stared as a teardrop cascaded down her cheek... When she felt a hand tap the rippled & regal fabric on her slumped, sinking sleeves. Eyebrows scrunching together, she turned to come face to face with the compassionate eyes of another contender; a baking fairy, armed with a warm smile that was calmly considerate enough to thaw through even the iciest of situations. Gently asking Princess Peppermint why she was sobbing, she tearfully explained, snickering with a sour snicker at how foolish & forgetful she was to be in her current circumstances. She sighed, stating that she was as ‚Äòscatterbrained as a snickerdoodle‚Äô. The fae told her not to fret. Producing a cutting board from their station, they handed the Princess their spare. Another contestant approached, gingerly offering her their selection of backup cookie cutters... Eventually, with the contestant's combined efforts, she felt like a kid in a candy store, for they had cooked up a full set of baking equipment! Elated, she enveloped the group just as the judges strolled through the doors. Princess Peppermint was awarded the silver medal for her circular, smooth peppermint creams, yet she felt like the true victor as she had received the sweetest treat she'd ever tasted; coordinated, collective culinary kindness... These sleeves are a close copycat of the material she exhibited that miraculous evening! Sloping & serene, they're the festively lax & final missing puzzle piece to complete a stylish visage! Wear them with a corset or without, you'll feel lavish even in loungewear by letting them loosely spin around your skin & sprawl over your forearms! (written by stixxntricks) Obtained through the Winter Advent Calendar!",
