    ["Mermaid Halo 2022"] = {
        ["Recolor"] = "Multi",
        ["CantTryOn"] = true,
        ["Creator"] = "Designed by ixchoco_, meshed by iiFer_plays, sparkled by Vioncii",
        ["Tags"] = "Halos",
        ["NumColorGroups"] = 0,
