            ["Color4"] = "Frosted Pearls",
            ["Color1"] = "Ocean Treasures"
        },
        ["Variants"] = false,
        ["ShortDescription"] = "Although the golden age of piracy has long sunk over the distant horizon, the resplendent but tarnished remnants of rags to riches stayed submerged under a silent sea that kept its secrets. As we gaze into the vastness of the stars & chart our courses, similarly so does anyone & anything that lurks leagues beneath the sea stare up at the same sky through the darkness. As above, so below, but what lies under an ocean of trust is only sculpted from the harrowing passage of time spent toiling through the tides... Concentrated aquatic sorcery whilst buried beneath the ocean for several eras & naturistic earth magic from sands unsullied by mortals has caused the coiling of shells, jewels, & doubloons. Centuries past, & now this circlet of long forgotten treasure & untamed energy has been summoned forth to be your halo. Foam forms within its core, a forever flowing free shoreline unshackled by the laws of the lunar cycle or the tumultuous torrent, its power endlessly threatening to overflow. It nearly makes you seasick to let your mind wander to whether such an item was a reward or an accursed omen, but then you recall that dead men tell no tales, so perhaps it is best to not question the ways of the waters. Every droplet is connected, after all. (Written by stixxntricks)",
        ["Unavailable"] = true,
        ["Style"] = {"Elegant", "Rare"},
        ["category"] = "Accessories",
        ["Alias"] = "Mermaid Halo 2022",
        ["EquipsTo"] = "Head",
