        ["Alias"] = "2022 Celebration Headband (Lower)",
        ["ShortDescription"] = "Celebrate the New Year with this shining & starry 2022 New Years Headband! Affix it to your head & prepare your last second silent wish on bated breath, for the stars close to your form may be fake, but your dreams are anything but! (description by stixxntricks)",
