        ["Tags"] = "Halos",
        ["NumColorGroups"] = 0,
        ["Unavailable"] = true,
        ["Variants"] = false,
        ["ShortDescription"] = "Deep within the Divinian Forest once stood an ample & mighty mangrove tree, imbued with an ancient & wise magic found deep within the earth. Every spring, residents would offer to the tree while seeking for a prosperous springtime... The tree has since withered, & its enchantment lost... However, the local beasts kept a keepsake in its memory. By harnessing their collective powers, a circlet was formed from the tree's deepest root. Laying the circle atop the decaying mangrove, to their astonishment, they returned to see that life had flourished even through despair. The branches were adorned with blooming lotuses, plump mushrooms, & a glowing pool fixed in the middle, sprouting fresh cattails. When the Dream Fountain answered your wish, perhaps it thought of no better guardian for the embodiment of odds defying life... Although, you wonder... Do the branches remember their time beyond rebirth? (written by stixxntricks)",
