    ["Angel Wings"] = {
        ["Recolor"] = "Multi",
        ["Creator"] = "JamJooJoo",
        ["Tags"] = {"Back"},
        ["NumColorGroups"] = 0,
        ["ColorNames"] = {
            ["Color2"] = "Straps",
            ["Color3"] = "Glowing Back Heart",
            ["Color4"] = "Wings Glitter",
            ["Color1"] = "Wings"
        },
        ["Variants"] = true,
        ["Unavailable"] = true,
        ["ShortDescription"] = "Available to win during the Winter Event! (A Celestial Story) (Chapter 1) When celestial bodies plummeted from the stratosphere, residents of a certain chilly town stirred with excitement as they scrambled to seek out these once illuminated wonders... But were aghast to discover that the remains of what they believed to be breathtaking falling stars were actually fallen angels who had been traversing above the realms. Dazed, they awoke in a world light-years beyond their own. Without a diamond to their name & their robes charred, their very wings scorched from their backs, their halos burnt to ash from their accidental descent, they found that all the memories they had of their home were just bygone echoes scattered across the void of space. These wordless observers watched the locals as they excitedly welcomed impassive strangers into their homes, stared silently as they were encouraged to take their place at the dinner table although they had never-hungry stomachs, & blinked at the scratchy sweaters the eager & enthusiastic elders had knitted to cradle their static skin. Those who dedicate patience to nurturing the meaning of the season may find themselves earning this pair of wings. Although imitation, they're worth more than divinity to a collection of once lost souls. The children of that particular town constructed these wings. Putting their care into every pretend feather, & leaving their hearts on their sleeves when shakily trailing drying sticks of glue down simplistic fragments of flimsy cardboard. When offered to humbled outsiders, their icy expressions finally broke. It's just children's arts & crafts, but it was enough to make seraphs sob. (written by stixxntricks)",
