    ["Opposites Attract Fingerless Gloves (Sleeves)"] = {
        ["Price"] = 25000,
        ["Unavailable"] = true,
        ["ShortDescription"] = [[A couple of easy to slip on crisscrossed sleeves, bound together by a series of continuous strings. A lacy fringe frills out from the upper edges, while the lower gloves cut off at the base of the fingers to ensure that you can show-off your punk painted fingernails! As its blueprints strictly stated, these combination sleeves seek to embolden the daring distinctiveness of whomever they're adorned on, rather than steal the show. This includes highlighting any articulate artistry that may be inked onto their skin. It is for this purpose that they can be swiftly detached & toggled in multiple ways; including their original state, sleeves without the tattoos, sleeveless arms with strings & without tattoos, & bare arms with tattoos. When unravelled, you may spot several phrases penned across a tiny tab on the inner sleeve, stitched into the fabric...
