    ["Goddess of TriumphüéóÔ∏èRibbon Parasol"] = {
        ["Unavailable"] = true,
        ["ShortDescription"] = [[With ruffles, ribbons, roses, and more, this divine parasol is a true sight to behold. N√∂a has spent countless nights crafting this parasol, making sure it turns out just perfect.

 (Tale of Triumph, Finale part 4) 

Soon, the sun itself went away. The kingdom's days had become colorless & barren. An uneasy atmosphere filled the deserted streets. All the shops & vendors had closed. The food was pale, the plants wilted, a bowl of fruit in the king's bedroom had turned to soot & was left there to remind him of time, & how little was left of it for their home. The chalk butterflies underneath the Goddess' statue had been smeared into white, bulbous smudges that resembled nothing, unrecognizable in their chaotic emptiness. A world silent, the very life of a nation stilled, occupied by people waiting for any sign of hope...

The head researcher swirled a vial of medicine, ignoring the king, who paced the stone floor of what was once the castle dungeons, but was now home to a laboratory. 
"I cannot comprehend it happening here. Why? For what reason? Why do we deserve this? Our people were peaceful, well fed, innocent..."
He trailed off upon turning to see the researcher frowning at him before rolling their eyes.
"This hasn't happened because of anybody's lack of care, sire. Nor because it was deserved. I have heard of this, far away & long ago. I'd heard it whispered as if it were a disturbing secret & accusers ostracized. There's no preparation. We simply do what we must to fight it."
Shifting, they filled a vial up with the contents of their research, before pouring it onto a steadily withering citrus fruit which sat atop their work table. 

"We'll be damaged, cobblestone cracked, buildings may topple, but I have faith in us, in them."
The scientist nodded their head towards their co-workers, who were gathered around various different tables. Some were copying the process the head researcher had just done, others were trying different methods. Some had placed flowers & fruits inside the machines. Others had inserted tubes into the dimming breads & goods of the kingdom, attached to scopes. The monarch knew little of their expertise. It made a man who cast a large shadow feel frightfully small, but this only gave him more reasons to respect those that help in different ways.

"I think I have an angle from which we can go about this,"
The scientist suddenly continued after a moment of reflection. The sovereign's head faced them.
"But I don't think we can do this alone." (written by stixxntricks)]],
