    ["Opposites Attract Transformation Dress & Bodice"] = {
        ["Price"] = 35000,
        ["Unavailable"] = true,
        ["ShortDescription"] = [[Transform your closet with this magnificently multipurpose versatile dress, bodice, skirt, and mermaid top, (7 toggles) specially suited to separate & switch up according to the wearer wishes! Tighten the tailored strings slashing against your sides, stride with sweetness as angels do, or take a splash in the sea in beachwear, for every requirement is covered all at once with this celebrated set piece! Endless possibilities are exemplified by the ceaselessly changeable characteristics, even down to switching the spikes on the choker in for a steel heart; each torso on the feminine style can have the skirt detached, while each skirt can also be worn separately to each bodice too! While little is known about the secretive stitcher of this outfit, their work seems to speak to shapeshifters in immeasurable emotional volumes. They certainly seem to understand how to market to be many-sided. Inspecting your new skirt or shirt, you may notice a label folded within the silky & smooth creases. One side displays a white set of seraph wings, the other is severed down the centre with inky black stitches. Small text aligning each side of the illustrated seams has you squinting to read it;
'(2) separate tails of the same chain intertwine
& the strings sequencing each side
strain to be twice as tensely tight
as the space between us stretches into the night.'
