        ["ShortDescription"] = "Available to win during the Winter Event! A shimmering & elaborate candelabra that branches outwards as countless extensive celebratory cedars do! You sometimes speculate whether the spirits of season's past may be encased within its copper casting on account of how the enlightened embers refuse to feebly fall faint, even under spluttering snowstorms, but you're aware that any determined damsel will make use of the divine with the aim of bounding into the embrace of her very own burning flame... As an heiress awaits a flickering glimpse of her dearest from behind a frosted sheet of glass, she will need ample lighting that won't succumb to the chilling air currents that spread throughout her relation's estate. Enchanting this item, she solemnly smiles at the sight of the bronze flora constructing candlestick's drip pans & budding along the column... Soon, spring shall shine, the sun shall snuff out this shivering solstice, & ablaze wax will have its necessity diminished into insignificant cinders. Yet, she will keep this candelabrum by her side to see her & her dazzling flame through their daring escape under the cover of darkness, & with success, into silent & undisturbed obscurity... (written by stixxntricks)",
