        ["ShortDescription"] = "This magical material enclosed tightly at the waist with a buttoned-up cincher is capable of possessing both feminine and masculine body styles! Combined with a water-logged pearl necklace showcasing sizeable jewels across your shoulders, you have the option to reveal or conceal their richness to your exact liking should you take advantage of the array of toggles! Choosing which side to support in this clash of styles lies between a linen blouse or intricate lacing, which includes toggleable sheer & satin capes. Also includes the belt from Whimsy Witch Academia Troublemaker Shoes in multiple sizes to fit more bodices. Curiously, if you approach large, open bodies of water while wearing either variation, you may feel a magical sensation of memories, your thoughts drifting out with the current as though you have experienced the nostalgia carried by the salt water. Momentarily, you will imagine a pirate's vessel caught in enchanted storm clouds above the ocean, staying afloat by creaking mechanical wings. You watch shards of shattered potion bottles & inky magic spill from the sides of the deck. Its contents streaming upwards into the swirling clouds, the eye of the storm can be seen within the mess of its own creation. (written by stixxntricks)",
