        ["Unavailable"] = true,
        ["ShortDescription"] = [[In the shape of a rose, these diamond earrings are a true beauty to own.
"A rose speaks of love silently in a language known only to the heart."

 (Tale of Triumph, Part 7)

The king hastily ran to the laboratory upon hearing the news, risen from another night of tossing & turning. He ran downstairs, boots pounding against the floor. The head researcher grasped at his shoulders as he opened the doors. The room echoed with scientific chatter as the researcher explained the situation. There was a cure, but just like the process, it would not work by itself. Whoever was willing to channel the cure, would likely be overwhelmed by the abundance of energy & power needed to do it. The king's gaze hardened, for they must do what is needed. What could be a more noble cause?

Citizens circled the barren plaza as their ruler stood in the middle. In one hand he held a small vial of golden liquid, while in the other he grasped his iron broadsword. Wide-eyed, the crowd stood & watched as he raised his sword, popped open the vial and suddenly a light appeared from him so bright they could no longer see.

The Goddess' statue had shattered into a thousand pieces, leaving pure light fading in its place. There stood a woman. Wearing lace & ribbons, in an elegant gown which pooled onto the white ground. She raised her parasol & she declared in a cool & commanding tone‚Ä¶

"To that which has entered our domain & sought nothing but evil & despair. This cowardice shall be struck with our majesty, summoned & strengthened by the courage & conviction of all mortals. I will battle on even when the people feel too weak to fight for themselves. No lives will be affected here at the hands of this evil, ever again. Farewell."

In a concluding flash of light, they blinked through their blotted vision to find their kingdom restored. The statue of the Goddess perfect & undamaged, risen from the ashes where its ruins once remained, only this time, represented in regal, single-hooped ribbons & lace.
Days turned into months after the tumultuous banishment of the kingdom's strife, & although life was never quite the same, and while the memory of the hardships resonated, it also brought them closer. Alliances had been formed with their charitable neighbors, and the fundraising would not stop, nor would the celebrations. The head researcher bid farewell to their monarch as they searched for faraway lands to spread knowledge of their experiences there, to seek more cures. Those who swam under the ocean & those who soared far above the clouds had heard of this affliction. It was fought & won in this instance, but the fight for a better tomorrow wasn't over. The king's personal seamstress who saw the savior's miracle had a burst of inspiration for their next collection, proceeds would be donated to charity. The land was most harmonious within the plaza, the statue of the Goddess had been transformed. Now, she was posed in an elegant gown with her parasol raised. A new plaque had been installed beneath her now heeled feet, surrounded by chalk circles of plump butterflies & a flight of devoted doves.

`The Goddess Of Triumph -
Blessed Are The Brave Who Push For More. º (written by stixxntricks)]],
