        ["ShortDescription"] = "(December's Dream, Chapter 6) Standing as still as the tall stone structures aligning the streets, December owlishly gawked at the man, lips parted as she fidgeted, scrambling to mentally compose herself after being caught off-guard. Today, she'd sauntered down numerous roads, kept herself afloat & adrift amongst a torrential shower of city-goers, & played the part of the prancing performer who let the public water down the artistry of her work into fitting background noise. Not once today had anybody looked directly at her instead of straight through her as though she was as mind-numbingly entertaining as the shallow snow piling up under her feet. Reminding herself to be careful what she wished for, she huffed, ripping her head away from his line of sight, just as a drained, yet trying smile plastered itself on his face. Despite what had just transpired, she found herself unable to move, glazed over. The song would end soon, & she would still be chasing the infantile illusion she had of simply uncovering its title when she knew even the melody would eventually repress itself into some cold corner of her brain. It was odd, she pirouetted above & beyond the eyes of thousands of onlookers a day, she should be higher than this by now. Time seemed to quicken as though it was mocking her, the sleek sliding doors of the store opening, the man stepped out, as so many others did that day. Fiddling with a sole strand of fancy yet faux fur on her muff, dangling from some string wrapped around her neck, she bit the inside of her cheek as the stranger started to venture out of view, turning the corner... (written by stixxntricks)",
