        ["Unavailable"] = true,
        ["Variants"] = true,
        ["Alias"] = "Iced Gingerbread Earrings",
        ["ShortDescription"] = "Available to win during the Winter Event! An ornamental pair of gingerbread friend-shaped earrings, dangling from your ears by glistening hooks! Molded from polymer clay, these confectionary companions were handcrafted into the realms by gentle hands. Although you've never seen the actual process up close, you can recall seeing documentaries on how they are sculpted on TV while you're flicking through the channels during a holiday movie marathon. Their bodies are carefully carved out with high-quality cookie cutters to cast their expressive, eager shapes. Contrastingly colored sections of clay are then bundled up & forged onto their forms to create their characterizing accents, even down to their dainty, bite-sized buttons. The craftspeople are often quizzed over their small, sweet smiles & dough-dropped eyes, as they are considered the most strenuous step in the recipe to get correct, but they exclaim that they'll never consider biting the biscuit, for each earring is never deserted, only continuously exerted over until it looks good enough to eat! After the oven has been preheated to 225¬∫ & they're certain they are as flat as a pancake, much like real desserts are, they are then placed in a toasty oven on a wafery baking sheet for precisely 10-12 minutes so their clay may harden, all the while being strictly monitored for any signs of burning by cautious bakers. Pliers are then utilized to thread the hook in their then gummy foreheads, & after some time left to cool in the frosty air, the grand process is complete! The credits then roll over a duo of adorable doughy delights that have just been cooked up into creation on-screen! (written by stixxntricks)",
