    ["Baby Penguin"] = {
        ["Recolor"] = "Multi",
        ["Alias"] = "Baby Star Penguin",
        ["Subfolder"] = "Christmas",
        ["Tags"] = "Hands",
        ["NumColorGroups"] = 0,
        ["ColorNames"] = {["Color2"] = "Tummy", ["Color3"] = "Stars & Cheeks", ["Color4"] = "Eyes", ["Color1"] = "Body"},
