            ["Boy"] = {["Animation"] = "rbxassetid://8098035247"},
            ["Girl"] = {["Animation"] = "rbxassetid://8097861358"}
        },
        ["ShortDescription"] = "Available to win during the Winter Event! A plump plushie of a petite & prim penguin, patched together with passion & prudence presumably by one of Snowpoint Summit's elders! Star accentuated eyes squashed shut & his flippers posed to stifle a sheepish giggle, his embarrassed blush is so compelling that you cannot resist smiling whenever you set your sights on him! You found this little fellow sticking out of a snowbank, alone, adrift, & without his waddle anywhere around. After some considerate scrubbing, he's now as clean & pristine as a flightless bird's sleek & streamlined feathers! Supposing that a child may have accidentally dropped him, you placed posters & asked around the realms to try & identify his owner, as you've received no reply, he seems to be permanently in your protection! Senior citizens might stop you on your strolls encircling Snowpoint Summit, citing that the sewing pattern used to construct his pudgy form was a standard staple of the realm in their youth. They may mumble to you an endearing rumor that they believed as children; so it goes, each penguin plushie has a heart-shaped pebble placed inside its stuffing, & it's said that if it's carefully squeezed tightly enough during the coldest night of the year, it may start to emit a soft & soothing glow... (written by stixxntricks)",
        ["Icon"] = "rbxassetid://8116118294",
        ["DefaultVariant"] = "Boy"
    },
