    ["Ice Prince Shawl Cape"] = {
        ["Recolor"] = "Multi",
        ["Creator"] = "iiFer_plays",
        ["Tags"] = {"Torso", "Back"},
        ["NumColorGroups"] = 0,
        ["Unavailable"] = true,
        ["Variants"] = true,
        ["Alias"] = "Ice Prince Shawl Cape",
        ["ShortDescription"] = "Available to win during the Winter Event! (The Snowglobe Story, Chapter 4) The queen's hand rested against her cheek, not even bothering to spare her usual icy glare at her kneeling sibling, what was left of her patience had finally frozen solid. Another thorn in her side. She had toiled over piles of etiquette books & glaciers of black ink to climb the mountainous terrain known only in oblivious queries as the royal heir's education, accumulating in her superior station on the cold throne the apple of her parent's eye now begged beneath. Although his sheltered innocence left him unfit for the sheer reality of his existence, he did make an admittedly decent decoration, more easily controlled than her uncivilized stepmother. But who did he have to thank for his appearance? His smooth capelet accented with a smart cravat & symmetrical epaulets wouldn't convince anybody that he had ever served in her military. The garment specifically tailored to meet his measly measurements, he was but a mannequin to exhibit her family's image that had deluded himself as being carved into some sort of sinless savior from the fractals of obscenity her ancestors curated... All because he assisted the poor. Even she spoiled him. Just when she thought what remained of her mother's soul had finally been icebound. Abruptly, she rose. With a sharp whisper, she ordered him to leave, banishing him into the uncharted territory of a careless solstice. When the queen speaks her orders, even the storms circulating above still. His cape ripped from his form, all Nyberg ‚Äî her reluctant right-hand warrior ‚Äî could do was watch as he vanished into a deep sea of white snow, never to be seen again. (written by stixxntricks)",
