    ["Angel Halo"] = {
        ["Recolor"] = "Multi",
        ["Creator"] = "OceanOrbs",
        ["Tags"] = {"Hats", "Halos"},
        ["NumColorGroups"] = 0,
        ["ColorNames"] = {["Color2"] = "Headband", ["Color3"] = "Halo Glitter", ["Color1"] = "Halo"},
        ["EquipsTo"] = "Head",
        ["Icon"] = "rbxassetid://6128358104",
        ["Style"] = {"Cute", "Costume", "Elegant", "Boys"},
        ["category"] = "Accessories",
        ["ShortDescription"] = "Available to win during the Winter Event! (A Celestial Story) (Chapter 2) At the opening evening of the school's play, teachers accepted the upsetting yet realistic possibility of an absent audience due to the suddenly surging snowstorm outside. Bracing themselves, the adults gawked in fear as the dusty red curtains split... To shockingly unveil that a group of fallen angels, dressed in gaudy sweaters & cardboard divinity, had filled their tiny schoolhouse to the brim. No longer speechless, these visitors cheered & clapped in unknown & unheard-of hurrahs that thundered over the clamoring cyclone outside. When small actors took their final bows, a warm glow enveloped the flightless friends, soon melting like snow, it revealed genuine halos & feathers in place of the thoughtful fakes, while the clouds outside parted to release a soft sunset after a taxing wintertide. Approaching the stage, the youngest, who hadn't quite grown into their real angelic features yet, placed a hooped headband & artificial wings onto one of the local children in unspoken gratitude. Shooting across the sky, they flew far beyond snowfall. Higher & higher until they were once more just mere specks in their night sky, soaring where they once plunged. This constructed halo is easy to make. It stands on shaky stalks, & is as delicate & fragile as snowflakes themselves, but that is what makes it so precious. A handed-down keepsake from long, long ago, only obtainable through special means... You find yourself feeling just a little bit kinder whenever you wear it. (End) (written by stixxntricks)",
