    ["Aurora's Battleaxe"] = {
        ["Recolor"] = "Multi",
        ["Creator"] = "ReddieTheTeddy (Concept by CHROMASTASIA)",
        ["Tags"] = "Hands",
        ["NumColorGroups"] = 0,
        ["ColorNames"] = {
            ["Color2"] = "Blade",
