            ["Color4"] = "Frozen Heart",
            ["Color1"] = "Handle & Slash Color"
        },
        ["Variants"] = true,
        ["Unavailable"] = true,
        ["ShortDescription"] = "Available to win during the Winter Event! (The Snowglobe Story, Chapter 2) A precious & elusive miracle is a warrior at rest. The night foregoing Aurora's battle, the air sat temporally still, humidity rare for the climate now dense in the stale air that can only be breathed in the eve before combat. Tossing & turning, sleep circumvented her. A befitting comparison to how she feared her blade would evade her frighteningly formidable opponent's reach. She would have to get close. Surely then, it was her own personal failings at being unable to handle the prospect of this ‚Äî & undoubtedly not the repetition of a swinging iron hammer ‚Äî that finally caused her to throw her bedsheets from her sweaty form. Descending the stairs to the forge, she witnessed the queen's most loyal warrior casually chipping away at a mighty yet majestic weapon beneath his thick, rugged hands. Hesitantly, she approached, as an outcasted animal inches towards an outstretched hand. Closer. Shifting, Nyberg effortlessly spun a newly constructed ornate battle axe into her firm grip. Reparation, an apology... Is what the ice fairies would call this. But she was never so easily swayed by finery. Blinking, she scowled at its body that she found needlessly swirled & gaudy... This was the handiwork of the queen's right hand alright, never skimming over the quality & the details. He trudges near, as animals do, & pats a rough hand against her strong shoulder. Calloused, but ready to rise above callousness. Shaped by her majesty's summit, but not frozen because of it. In words only a soldier who predicts imminent defeat can utter, he mumbles to her. 'Hvars √æ√∫ b√∂l kannt, kve√∞ √æ√∫ √æ√©r b√∂lvi.' On the climatic dawn of the duel, Nyberg was standing by Aurora's side, the queen's soldiers, servants, & subjugated subjects closely trailing. (written by stixxntricks)",
