    ["Mend My Heart Stitched Teddy"] = {
        ["Price"] = 13000,
        ["Unavailable"] = true,
        ["ShortDescription"] = "The roughest & toughest teddy you've ever seen! After spotting it up for sale at a local thrift shop, the staff were unusually hasty as they hauled it into a bag. It was only upon returning home that you swiftly understood why; constant scowling, stomping, & sour attitudes causes the bears stitches to require constant care! It's almost terrifying how truly terrible this teddy can be! Originally donated as an unwanted Valentines Day gift, loneliness & a lack of love has left this snarling stuffie with a sewing needle in its side. Having to patch up the fragments of its fabric all by itself, the secret sensitive soul that resides deep beneath its stuffing ever searches for someone with the potential to repair its pieced apart heart... In the search of comfort for your torso sized terror, you may even find yourself purchasing a second 'Mend My Heart Stitched Teddy' to toggle alongside the first... This, however, only exaggerates the problem; it will then have a partner in crime! (Written by stixxntricks) (*Stackable)",
